def composite_nums_between_indices(lst):
    def is_composite(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return True
        return False

    return {num for i, num in enumerate(lst) if 35 <= i <= 49 and is_composite(num)}
